import Item from "./components/Item";
function App() {
  let iten_date = new Date(2022 - 12 - 20);
  let item_name = "Car insurance";
  let item_price = 500;
  return <Item date={item_date} name={item_name} price={item_price}></Item>;
}
export default App;
